import React from 'react';
import Auxi from '../Auxi/Auxi';
import Footer from '../../containers/footer/footer';
const layout =(props)=>{
    return(
        <Auxi>
            <div>logo search notification</div>
            <div>navbar</div>
            <div>nav title</div>
            <main>
                {props.children}
            </main>
            <Footer/>
        </Auxi>
    );
}
export default layout;
